(76,"q"),cs(77,"ppII(99%)"),ns(),cs(78," y la cadena "),ts(79,"q"),cs(80,"ppIII(1%)"),ns(),cs(81,". Esta dos cadenas se dan en estrellas que presentan temperaturas superiores a 20Mk y en la presencia de part\xedculas alfas."),ns(),ts(82,"h4"),cs(83,"b.) Ciclo CNO"),ns(),cs(84," Es un mecanismo que usa el C"),ts(85,"sup"),cs(86,"12"),ns(),cs(87," como catalizador, de tal forma que se regenera al final del ciclo despu\xe9s de haber utilizado 4 protrones. En las figuras siguientes(4.3-4.4), podemos observar un diagrama del proceso y todas las reacciones que se dan en el mecanismo. "),ts(88,"div",2),ts(89,"div",3),ts(90,"a",7),os(91,"img",9),ns(),ts(92,"p"),cs(93,"Figura 4.4: Diagrama del ciclo CNO. "),ns(),ns(),ts(94,"div",10),ts(95,"a",7),os(96,"img",11),ns(),ts(97,"p"),cs(98,"Figura 4.5: Reacciones presentes en este ciclo. "),ns(),ns(),ns(),ts(99,"p"),cs(100,"Este mecanismo es m\xe1s predominante o importante en estrellas mucho m\xe1s masivas que el Sol . Este mecanismo es capaz de producir m\xe1s energ\xeda que la "),ts(101,"q"),cs(102,"cadena p-p"),ns(),cs(103," pero necesita temperaturas mucho m\xe1s elevadas."),ns(),ts(104,"h4"),cs(105,"Combusti\xf3n de helio"),ns(),ts(106,"p"),cs(107,"Este mecanismo se da en estrellas mucho m\xe1s masivas que el Sol. Debido a que en estas estrellas al enconntrarse el helio a tan alta temperatura pude fusionarse para dar carbono, mediante un mecanismo denominado triple-alfa, que esta formado por dos etapas: "),ns(),ts(108,"div",12),ts(109,"div",13),ts(110,"a",7),os(111,"img",14),ns(),ts(112,"p"),cs(113,"Figura 4.6: Reacciones del mecanismo triple-alfa. "),ns(),ns(),ns(),ts(114,"p"),cs(115,"Estos nuevos elementos obtenidos pueden reaccionar a su vez con part\xedculas alfas para as\xed obtener elementos mucho m\xe1s pesados y una gran cantidad de neutrones."),ns(),ts(116,"h4"),cs(117,"Otros mecanismos"),ns(),ts(118,"p"),cs(119,'Los mecanismos de los que vamos hablar ahora se dan en estrellas muy masivas adem\xe1s de que son mecanismos de producci\xf3n de elementos muy pesados. En este tipo de mecanismos podemos considerar los procesos de combusti\xf3n del carbono al silicio, este tipo de mecanismo se da en estrellas 8 veces m\xe1s masivas que el sol, a partir del carbono mediante este tipo de mecanismos se puede llegar a obtener hasta el Fe-Ni. Despu\xe9s de estos elementos, ya no puede darse por combusti\xf3n elementos m\xe1s pesados, si no que se dan por otro tipo de procesos denominados "procesos de captura electr\xf3nica". Es un mecanismo en el cual un electr\xf3n at\xf3mico se combina con un prot\xf3n del n\xfacleo para formar un neutr\xf3n y un neutrino. '),ns(),ts(120,"h3"),cs(121,"Fuentes :Origen gal\xe1ctico"),ns(),ts(122,"p"),cs(123,"En este modelo se considera que los rayos c\xf3smicos se generan en el interior de nuestra galaxia y se mantenienen en ella a lo largo del tiempo. Existen dos formas esenciales de interpretar este modelo gal\xe1ctico, el modelo de disco y el modelo de halo. En el modelo de disco considera que los rayos c\xf3smicos se encuentran confinados en el disco gal\xe1ctico y el modelo de halo considera que las fuentes se encuentran situadas en el disco gal\xe1ctico y los rayos c\xf3smicos quedar\xedan confinados en una zona esf\xe9rica. Estos modelo presentan el problema de que tipo de fuente debemos considerar, es decir, si las fuentes son difusas o discretas. En los inicios se supuso que las fuentes eran discretas, debido a que las supernovas generaban la energ\xeda suficiente como para acelear o crear estos rayos c\xf3smicos. En cambio, E.Fermi, supuso el otro enfoque, en el cu\xe1l las particulas son aceleradas en el medio intelestelar por la colisi\xf3n con los campos magn\xe9ticos. Actualmente se considera que la supernova produce la primera aceleraci\xf3n y la aceleraci\xf3n definitiva era producida por los mecanismos que explic\xf3 Fermi."),ns(),ts(124,"h4"),cs(125,"Supernovas"),ns(),ts(126,"p"),cs(127,"Una supernova es un explosi\xf3n repentina de una estrella. las supernovas pueden clasificarse en tipo I y II , en nuestro caso nos centraremos en el tipo II debido a que son las fuentes de rayos c\xf3smicos. Estas supernovas pueden darse en estrellas con masa 9 veces superior a la del Sol y con una temperatura muy elevado. Estas estrellas son capaces de sintetizar hasta el Fe "),ts(128,"sup"),cs(129,"56"),ns(),cs(130," en part\xedculas alfas, esta sintesis puede producir un violento colapso del n\xfacleo de la estrella. Este colapso provoca que las capas exteriores tengan una mayor temperatura y al estar fomradas por elementos m\xe1s ligeros que el hierro, se generan reacciones exonerg\xe9ticas que pueden producir la explosi\xf3n de la estrella. Despu\xe9s de esta explos\xed\xf3n se origina la denominada estrella de neutrones o enanas blancas."),ns(),ts(131,"div",12),ts(132,"div",15),os(133,"iframe",16),ts(134,"p"),cs(135,'Figura 4.8: Simulaci\xf3n de la explosi\xf3n de una supernova. Derechos de autor "'),ts(136,"a",17),cs(137,"GIPHY"),ns(),cs(138,'" '),ns(),ns(),ns(),ts(139,"h4"),cs(140,"Propagaci\xf3n en el medio intelestelar"),ns(),ts(141,"p"),cs(142," Los rayos c\xf3smicos se mueven por el espacio como un part\xedcula cargada en el interior de un campo magn\xe9tico, siendo su componente de trayectoria aleatoria debido a la irregularidad del campo magn\xe9tico. Al propagarse por el medio intelesterlar al composici\xf3n qu\xedmica de estos rayos c\xf3smicos cambia produci\xe9ndose isotopos que no hab\xedan sido originados en la nucleos\xedntesis. Por \xfaltimo, hablar que los mecanismos de propagaci\xf3n no se encuentran bien definidos debido a que el mecanismo va a depender de la naturaleza del rayo. En modelo m\xe1s usado es caja de fufas, donde los rayos c\xf3smicos residen en el disco gal\xe1ctico con a presencia de un escape hac\xeda el halo."),ns(),ts(143,"h3"),cs(144,"Fuentes: Origen Extragal\xe1ctico"),ns(),ts(145,"p"),cs(146,"Los rayos de origen extragal\xe1ctico presentan energ\xedas mucho mayores que las que puede generar una supernova y los campos magn\xe9ticos de nuesstra galaxia no son capaces de contenerlos. Al presentar una energ\xeda tan elevada estos rayos se propagan a lo largo del espacio en trayectoria rectilinea, por lo tanto, si sabemos su direcci\xf3n de entrada podemos deducir de donde proceden y su origen. Cabe mencionar que todav\xeda no es muy precisa la determinaci\xf3n de la trayectoria de estos rayos c\xf3smicos. "),os(147,"br"),os(148,"br"),cs(149," Ahora bien, vamos a ver que clase de objetos celestes pueden acelerar los iones dentro de su propio campo magn\xe9tico. "),os(150,"br"),cs(151," Para que dicho cuerpo pueda acelerar dichos iones debe darse la siguiente condici\xf3n: "),os(152,"br"),ts(153,"span",18),cs(154,"E "),ts(155,"sub"),cs(156,"M"),ns(),cs(157," = \u03b3 ZBR "),ns(),os(158,"br"),cs(159,",donde \u03b3 es el factor de Lorentz de la onda de choque que produce la aceleraci\xf3n, Z es la carga de i\xf3n a acelerar, B el campo magn\xe9tico y R la dimensi\xf3n lineal del objeto estelar. En la figura 4.9 podemos observar los diferentes cuerpos celestes candidatos a acelerar estos iones:"),ns(),ts(160,"div",2),ts(161,"div",13),ts(162,"a",7),os(163,"img",19),ns(),ts(164,"p"),cs(165,"Figura 4.9: Diagrama campo magn\xe9tico-tama\xf1o de los posibles lugares donde se pueden acelear los rayos c\xf3smicos. "),ns(),ns(),ns(),ts(166,"p"),cs(167,"En esta imagen podemos observar las condiciones necesarias para poder acelerar protones y hierro. Vamos a analizar dicha imagen:"),ns(),os(168,"br"),ts(169,"ul",20),ts(170,"li"),cs(171,"Las diagonales son las condiciones necesarias para que protones y el hierro sean aceleradas."),ns(),ts(172,"li"),cs(173,"Por debajo de la diagonal del prot\xf3n menos energ\xe9tico no existe ning\xfan cuerpo celeste que puede acelerarlos."),ns(),ts(174,"li"),cs(175,"Por encima de las diagonaes podemos encontrar los objetos celestes que pueden acelerar estos n\xfacleos at\xf3micos. Algunos objeros que podr\xedan acelerar estas part\xedculas pueden ser: Estrellas de Neutrones, Estrellas magn\xe9ticas,Galaxias,etc."),ns(),ns(),ts(176,"h2"),cs(177,"Rayos c\xf3smicos: primarios y secundarios."),ns(),ts(178,"p"),cs(179,"En lo que sigue, vamos a hablar de la distincci\xf3n que hacemos entre los rayos c\xf3smicos primarios y los secundarios. De una forma sencilla, podemos decir que los rayos c\xf3smicos primarios son aquellos que se propagan desde la fuente creadora hasta nuestra atm\xf3sfera y los rayos c\xf3smicos secundarios son los generados por la interacci\xf3n de los rayos c\xf3smicos primarios con las part\xedculas contenidas en el aire atmosf\xe9rico. Vamos a explicar cada tipo por separado."),ns(),ts(180,"h3"),cs(181,"Rayos c\xf3smicos primarios."),ns(),cs(182," En los apartados anteriores hemos hablado de la creaci\xf3n, origren y aceleraci\xf3n de los rayos c\xf3smicos. Concretamente estos rayos c\xf3smico son los denominados rayos c\xf3smicos primarios, por lo tanto, en este apartado vamos a hablar exclusivamente de la composici\xf3n y energ\xeda de estos rayos c\xf3smicos. "),ts(183,"h4"),cs(184,"Composici\xf3n"),ns(),ts(185,"p",20),cs(186," En la figura 4.10 observamos la abundancia de los elementos encontrados en la radiaci\xf3n c\xf3smica primaria. Los grupos de la figura se identifican de acuerdo con el n\xfameo at\xf3mico (Z) : Z =1 hidr\xf3geno, Z = 2 helio, Z = 3-5 elementos ligeros, Z = 6-9 elementos medianos y los pesados Z => 10. Subgrupos de estos \xfaltimos son los elementos muy pesados (Z = 20-30), los elementos m\xe1s pesados que el hierro (Z = 31 -82) y los elementos superpesados Z =>100."),ns(),ts(187,"div",21),ts(188,"button",22),ss("click",function(){return t.VerTabla()}),cs(189,"Ver tabla"),ns(),ts(190,"table",23),ts(191,"caption",24),cs(192," Figura 4.1 : Abundancia relativa de los elementos de la radiaci\xf3n c\xf3smica primaria."),ns(),ts(193,"tbody"),ts(194,"tr",25),ts(195,"th"),cs(196,"Grupo"),ns(),ts(197,"th"),cs(198,"Elemento"),ns(),ts(199,"th"),c